    false,nt"url": null,nt"notes": "BPI Structures are derived from two scales
    of a focal mean analysis on bathymetry and slope. The grid is based on gridded (10
    m cell size) multibeam bathymetry, collected aboard NOAA Ship Hi'ialakai and R/V
    AHI, and it was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
    Cell values represent one of 14 classes in an index of seafloor terrains. This data
    set is for the shelf and slope environments of Supply Reef. As part of the northern
    islands of the Mariana Islands archipelago, the classification dictionary that was
    used defines a shelf as being above -60m and a deep shelf as being below -60m. However,
    Supply Reef does not have any significant shelves, rather an overall trend of escarpments
    lead from the top of the reef to the abyss.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
